              function drawGraph() {
                  var container = document.getElementById('mynetwork');

                  

                  // parsing and collecting nodes and edges from the python
                  nodes = new vis.DataSet([{"color": "#97c2fc", "id": "Weights_package", "label": "Weights_package", "shape": "dot"}, {"color": "#97c2fc", "id": "Use_=--target_os=android23-arm64=_to_build_for_Android_API_23", "label": "Use_=--target_os=android23-arm64=_to_build_for_Android_API_23", "shape": "dot"}, {"color": "#97c2fc", "id": "Build", "label": "Build", "shape": "dot"}, {"color": "#97c2fc", "id": "Compile", "label": "Compile", "shape": "dot"}, {"color": "#97c2fc", "id": "For_some_reason_only_debug_version_of_the_library_can_be_used", "label": "For_some_reason_only_debug_version_of_the_library_can_be_used", "shape": "dot"}, {"color": "#97c2fc", "id": "Latest", "label": "Latest", "shape": "dot"}, {"color": "#97c2fc", "id": "Refresh_all_CK_repositories_after_any_updates_(e.g.\u00a0bug_fixes)_", "label": "Refresh_all_CK_repositories_after_any_updates_(e.g.\u00a0bug_fixes)_", "shape": "dot"}, {"color": "#97c2fc", "id": "Record_benchmarking_results_to_the_CK_repository", "label": "Record_benchmarking_results_to_the_CK_repository", "shape": "dot"}, {"color": "#97c2fc", "id": "Analyze_experimental_results", "label": "Analyze_experimental_results", "shape": "dot"}, {"color": "#97c2fc", "id": "Benchmark", "label": "Benchmark", "shape": "dot"}, {"color": "#97c2fc", "id": "Setup_Instructions_-_Docker", "label": "Setup_Instructions_-_Docker", "shape": "dot"}, {"color": "#97c2fc", "id": "ImageNet_dataset", "label": "ImageNet_dataset", "shape": "dot"}, {"color": "#97c2fc", "id": "If_you_wish_to_place_the_models_in_your_assets_manually,", "label": "If_you_wish_to_place_the_models_in_your_assets_manually,", "shape": "dot"}, {"color": "#97c2fc", "id": "This_only_updates_CK_repositories_on_the_host_system._To_update", "label": "This_only_updates_CK_repositories_on_the_host_system._To_update", "shape": "dot"}, {"color": "#97c2fc", "id": "Set_up_environment_variables", "label": "Set_up_environment_variables", "shape": "dot"}, {"color": "#97c2fc", "id": "Install_SSD-ResNet 8"}, {"from": "Benchmark", "id": "Benchmark_to_ImageNet_dataset", "to": "ImageNet_dataset"}, {"from": "TensorFlow_models", "id": "TensorFlow_models_to_Use_=--target_os=android23-arm64=_to_build_for_Android_API_23", "to": "Use_=--target_os=android23-arm64=_to_build_for_Android_API_23"}, {"from": "Build_(Linux_or_Windows)", "id": "Build_(Linux_or_Windows)_to_Refresh_all_CK_repositories_after_any_updates_(e.g.\u00a0bug_fixes)_", "to": "Refresh_all_CK_repositories_after_any_updates_(e.g.\u00a0bug_fixes)_"}, {"from": "Set_up_environment_variables", "id": "Set_up_environment_variables_to_Refresh_all_CK_repositories_after_any_updates_(e.g.\u00a0bug_fixes)_", "to": "Refresh_all_CK_repositories_after_any_updates_(e.g.\u00a0bug_fixes)_"}]);

                  nodeColors = {};

                  for (nodeId in allNodes) {

                  allEdges = edges.get({ returnType: "Object" });
                  // adding nodes and edges to the graph
                  data = {nodes: nodes, edges: edges};

                  var options = {"nodes": {"font": {"size": 12, "color": "black"}, "shapeProperties": {"useBorderWithImage": true}}, "edges": {"length": 1050}, "physics": {"stabilization": {"enabled": true, "iterations": 1000}, "hierarchicalRepulsion": {"centralGravity": 0.0, "springLength": 700, "springConstant": 0.01, "nodeDistance": 750, "damping": 0.09}, "solver": "hierarchicalRepulsion", "timestep": 0.5}, "layout": {"hierarchical": {"enabled": true, "blockShifting": true, "parentCentralization": true, "sortMethod": "directed"}}};
